import { useState, useEffect } from 'react';

export default function Mac() {
   const [products, setProducts] = useState([]);

   useEffect(() => {
      fetch('http://localhost:3000/products')
         .then((r) => r.json())
         .then((data) => setProducts(data));
   }, []);

   return products
      .filter((product) => product.title.includes('Mac'))
      .filter((product) => product.title.excludes('MacBook'))
      .map((product) => (
         <div key={product.id}>
            <img src={product.image} alt={product.title + product.model} />
            <h1>{product.title}</h1>
            <p>{product.model}</p>
            <p>{product.details}</p>
            <p>{product.price}</p>
         </div>
      ));
}
